from collections import Counter
class Solution:
    def get_sublist_of_size_n(self, s: str, n: int) -> list[list[str]]:
        assert n <= len(s)
        sublist = [s[i:i+n] for i in range(len(s)) if i+n<=len(s)]
        return sublist


    def max_letters_check(self, list_: list[list[str]], m: int) -> list[list[str]]:
        sublist = [i for i in list_ if len(list(set(i))) <= m]
        return sublist


    def maxFreq(self, s: str, maxLetters: int, minSize: int, maxSize: int) -> int:
        sublist = self.max_letters_check(self.get_sublist_of_size_n(s, minSize),maxLetters)
        if sublist:
            count_dict = Counter(sublist)
            return max(count_dict.values())
        else: return 0




























